import React from 'react';
import Header from '../components/Header';

function Login() {
    return (
        <>
        <div className='form-signin-dark mt-4 mb-3 position-static'>
            <div className='container-fluid-danger'>


            <h3 className='h3-light mb-3 fw-normal'>Please Sign-in</h3>
            <div className='form-floating'>
                <input className='form-control-sm mt-3' type='email' placeholder='name@example.com' />


            </div>
            <div className='form-floating'>
                <input className='form-control-sm mt-3' type='Password' placeholder='Password' />


            </div>
            <button className="w-20 btn btn-md btn-primary position-static mt-3" type="submit">Sign in</button>
          </div>
          </div>

        </>
    );
}

export default Login;
